import styled from 'styled-components';

export const Wrapper = styled.div`
  width: 200px;
  height: 600px;
  background-color: blue;

  position:absolute; /*it can be fixed too*/
  left:0;
  right:0;
  top:0;
  bottom:0;
  margin:auto;


`;

export const Title = styled.div`
  font-size: 18px;
  color: #0058e4;
`;
